import React from "react";
import {
  Container,
  Text,
  CommandButton,
  PrimaryButton,
  SearchInput,
  OutlinedButton,
  ActionButton,
  Header,
  SubHeader,
} from "../../styledComponents";
import styled from "styled-components";

const Wrapper = styled(Container)`
  display: flex;
  flex-direction: column;
  flex: 0.8;
  width: 100%;
  padding-top: 0px;
  padding-left: 110px;
  padding-bottom: 0px 110px;
  padding-right: 0px 110px;
`;
const SideContainer = styled(Container)`
  display: flex;
  flex-direction: column;
  width: 100%;
  flex: 0.2;
  background-color: white;
`;
const Card = styled(Container)`
  display: flex;
  flex-direction: column;
  height: 100px;
  min-width: 250px;
  background-color: white;
  border-radius: 3px;
  padding: 15px;
  margin-right: 10px;
`;
const ActionBtn = styled(ActionButton)`
  display: flex;
  justify-content: center;
  align-items: center;
  align-content: center;
  padding-right: 10px;
  padding-left: 10px;
  border-radius: 2px;
  background-color: ${({ theme }) => theme.lightGrey};
`;
const Dashboard = () => {
  return (
    <Container flex={1} row>
      <Wrapper>
        <Container row customStyles={{ paddingTop: 40, paddingBottom: 20 }}>
          <SubHeader customStyles={{ marginRight: 10 }}>
            Welcome back,
          </SubHeader>

          <SubHeader customStyles={{ color: "#6FCC16" }}>Rene La</SubHeader>
        </Container>
        <Container
          customStyles={{ paddingTop: 20, paddingBottom: 20 }}
          wrap
          row
        >
          <Card>
          <Container row ></Container>
          </Card>

        </Container>
      </Wrapper>
      <SideContainer />
    </Container>
  );
};

export default Dashboard;
